import styled from "styled-components"

const Container = styled.div`
    width: 92%;
    display: grid;
    grid-template-columns: 140px auto;
    grid-template-rows: auto auto 24px 36px;
`

const Image = styled.div`
    grid-column-start: 1;
    grid-column-end: 1;
    grid-row-start: 1;
    grid-row-end: 5;
    height: 140px;
`

export default function ProductSearchView() {
    return <Container>
        <Image />
    </Container>
}
